import React, { useState, useEffect } from 'react';

function DietJournal() {
    const [entries, setEntries] = useState(Array(8).fill({ meal: '', calories: '', category: '' }));
    const [predefinedMeals, setPredefinedMeals] = useState([]);

    useEffect(() => {
        // Fetch predefined meals from your API endpoint
        fetch('your_api_endpoint')
            .then(response => response.json())
            .then(data => {
                // Assuming data is an array of meal names
                setPredefinedMeals(data);
            })
            .catch(error => console.error('Error fetching predefined meals:', error));
    }, []);

    const handleEntryChange = (index, event) => {
        const { name, value } = event.target;
        const newEntries = [...entries];
        newEntries[index][name] = value;
        setEntries(newEntries);
    };

    const addEntry = () => {
        if (entries.length < 20) {
            setEntries([...entries, { meal: '', calories: '', category: '' }]);
        }
    };

    const removeEntry = (index) => {
        const newEntries = [...entries];
        newEntries.splice(index, 1);
        setEntries(newEntries);
    };

    return (
        <div>
            <h5>Diet Journal</h5>
            <table style={{ width: '100%', marginBottom: '20px', maxHeight: '400px', overflowY: 'auto' }}>
                <thead>
                    <tr>
                        <th>Meal</th>
                        <th>Calories</th>
                        <th>Category</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    {entries.map((entry, index) => (
                        <tr key={index}>
                            <td>
                                <select
                                    name="meal"
                                    value={entry.meal}
                                    onChange={(event) => handleEntryChange(index, event)}
                                >
                                    <option value="">Select Meal</option>
                                    {predefinedMeals.map((meal, i) => (
                                        <option key={i} value={meal}>
                                            {meal}
                                        </option>
                                    ))}
                                </select>
                            </td>
                            <td>
                                <input
                                    type="text"
                                    name="calories"
                                    value={entry.calories}
                                    onChange={(event) => handleEntryChange(index, event)}
                                    placeholder="Calories"
                                />
                            </td>
                            <td>
                                <input
                                    type="text"
                                    name="category"
                                    value={entry.category}
                                    onChange={(event) => handleEntryChange(index, event)}
                                    placeholder="Category"
                                />
                            </td>
                            <td>
                                <button onClick={() => removeEntry(index)}>Remove</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <button onClick={addEntry}>Submit Entry</button>
        </div>
    );
}

export default DietJournal;
